import { ReactNode } from "react";
import cl from "./Button.module.css";

interface PropButton {
  children?: ReactNode;
  type: string;
  size: string;
  variant: string;
}

export const Button = ({
  children = "Click me",
  type,
  size = "medium",
  variant = "square",
}) => {
  return (
    <button
      className={[cl.button, cl[size], cl[variant]].join(" ")}
      type={type}>
      {children}
    </button>
  );
};
